import React, { Component } from 'react';
import { Collapse, Form, Tabs, Layout, Menu, Input, Row, Col, Button, DatePicker, Radio, Card } from 'antd';
import { Link } from "react-router-dom";

const { Header, Sider, Content } = Layout;
const Panel = Collapse.Panel;


class CreateNewRequest extends Component {

    constructor(props) {
        super(props);

    }


    render() {

        return (
            <div>
                <Layout>
                    <Header >
                        <Row>
                            <Col xs={6} sm={6} md={6} lg={6} xl={6}>
                                <Link to={{ pathname: "/home" }}>Back</Link>
                            </Col>
                            <Col xs={14} sm={14} md={14} lg={14} xl={14}>
                                <h3 className="color-white">CREATE NEW REQUEST</h3>
                            </Col>
                        </Row>
                    </Header>
                    <Content>
                        <Panel header="Employee Registration" key="1">
                            <Form>
                                <Row>
                                    <Col xs={12} sm={12} md={12} lg={12} xl={12}>
                                        <Card title="Employee Details">
                                            <Form.Item>
                                                <Input type="text" name="firstName" placeholder="First Name" />
                                            </Form.Item>

                                            <Form.Item>
                                                <Input type="text" name="lastName" placeholder="Last Name" />
                                            </Form.Item>
                                        </Card>
                                    </Col>
                                </Row>
                            </Form>
                        </Panel>

                    </Content>
                </Layout>
            </div >
        );
    }

}

export default CreateNewRequest;
